import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards"
import "./index.css"
import Sdata from "./Sdata"

ReactDOM.render(
  <>
  <h1 className="heding_style" >List Of Top Five Netflix In 2022 </h1>
  <div className="xyz">
    <Cards imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].imgsrc}
      source={Sdata[0].imgsrc}
      sname={Sdata[0].imgsrc}
    />
    <Cards imgsrc={Sdata[1].imgsrc}
      title={Sdata[1].imgsrc}
      source={Sdata[0].imgsrc}
      sname={Sdata[0].imgsrc}
    />
    <Cards
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].imgsrc}
      source={Sdata[0].imgsrc}
      sname={Sdata[0].imgsrc}
    />
    <Cards
      imgsrc="https://wallpapercave.com/wp/wp1917154.jpg"
      title="A Netflix Orignal Series"
      source="https://www.netflix.com/in/title/80990668?source=35"
      sname="Stranger Things"
    />
    <Cards
      imgsrc="https://wallpapercave.com/wp/wp1917154.jpg"
      title="A Netflix Orignal Series"
      source="https://www.netflix.com/in/title/80990668?source=35"
      sname="Stranger Things"
    />
    </div>
  </>, document.getElementById('root')
);
